    [],nt"revision_timestamp": "2016-07-15T04:25:17.233834",nt"name": "list-of-excluded-individuals-and-entities-cb508",nt"isopen":
    true,nt"url": null,nt"notes": "<p>Our objective is to ensure that providers
    who bill Federal health care programs do not submit claims for services furnished,
    ordered or prescribed by an excluded individual or entity.  The LEIE is updated
    monthly with all individuals and entities who have been excluded from participation
    in Federal health care programs.  Providers who bill Medicare, Medicaid, or other
    Federal health care programs must ensure that they know what individuals or entities
    are excluded and not bill for their services (e.g., a pharmacy should not bill Medicaid
    for a drug prescribed by an excluded physician nor for drugs dispensed by an excluded
    pharmacist).</p>n",nt"license_title": "Other License Specified",nt"extras":
